import React, { Component, Fragment } from "react";
import {Row, Col} from "react-bootstrap";
import "./animepages.component.css"
import { Link } from "react-router-dom";


export function AnimeInfo(props){
        return (
            <Fragment>
                <Col>
                    <Row id="info-block">
                        <div>Summary: </div>
                        <div>{props.summary}</div>
                    </Row>
                    <br></br>
                    <Row id="info-block">
                        <div>Season: {props.season} {props.seasonYear}</div>
                    </Row>
                    <br></br>
                    <Row id="info-block">
                        <div>Episodes: {props.episodes}</div>
                    </Row>
                    <br></br>
                    <Row id="info-block">
                        <div>Studio: {props.studio.nodes.map((studios) =>(
                            studios.name
                        ))}</div>
                    </Row>
                </Col>
            </Fragment>
            
        );
}

export function KeyStaff(props) {
        return (
            <Fragment>
                <Col>
                </Col>
            </Fragment>
            
        );
}

export class Rating extends Component {
    render() {
        return (
            <Fragment>
                <Col>
                    <div>Sample Rating</div>
                    <div>10/10</div>
                </Col>
            </Fragment>
            
        );
    }
}

export class Recommendations extends Component {
    render() {
        return (
            <Fragment>
                <Col>
                <div>Anime One</div>
                <div>Anime Two</div>
                </Col>
            </Fragment>
            
        );
    }
}

